import React from 'react';
import { Routes,Route } from 'react-router-dom';

import './App.css';
import {AddUser} from './components/AddUser'

function App() {
  return (
    <Routes>
      <Route exact path="/" element={<AddUser />} />
    </Routes>
  );
}

export default App;
